import Head from 'next/head'
import Navbar from "./Navbar";
import '../pages/styles.css'



const Layout = (props) => (
    <div className={styles.bodyWrap}>
        <Head>            
        </Head>
        <Navbar />
        <p className={styles.die}>safdfargsag</p>
        {props.children}
    </div>
)

export default Layout
